import axios from "axios";


const BASE_URL = "http://mytest.vn:8080/Client";
export const api = axios.create({
    baseURL: BASE_URL,
    withCredentials: true,
    headers: {
        'Content-Type': 'application/json', 
        'Accept': 'application/json',
    }
});
